import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route,} from "react-router-dom";

import Home from './contents/Home';
import Navbar from './components/Navbar';
import About from './contents/About';

function App() {

return (
<Router>
  <div className="App">
    <Navbar />
    <Route exact path="/">
      <Home />
    </Route>
    <Route path="/about">
      <About />
    </Route>
  </div>
</Router>
)

}

export default App;
